import React from "react";
import makeStyles from "@mui/styles/makeStyles";
import logo from "./png-clipart-computer-icons-menu-bar-icon-design-hamburger-button-others-miscellaneous-angle-removebg-preview.png";
import profile_logo from "./download-removebg-preview.png";
export default function Navbar() {
  window.addEventListener("scroll", function(){
    if(window.scrollY==0){
      //user is at the top of the page; no need to show the back to top button
      goToTop.style.display = "";
    } else {
      goToTop.style.display = "block";
    }
  });
  const useStyles = makeStyles((theme) => ({
    navbar: {
      fontFamily: "Afacad",
      color: "black",
      fontSize: "20px",
      position: "fixed",
      width: "100%",
      backgroundColor:"white",
      paddingBottom:"20px"
    },
    for_ul: {
      display: "flex",
      listStyleType: "none",
      justifyContent: "space-between",
      alignItems: "center",
    },
    for_probut: {
      display: "flex",
      marginRight: "20px",
      justifyContent: "center",
      alignItems: "center",
      width: "100px",
      height: "50px",
      backgroundColor: "yellow",
      borderRadius: 50,
      border: "1px solid",
    },
    for_profile: {
      height: "20px",
    },
    for_menu: {
      height: "15px",
      marginRight: "13px",
    },
    for_searchbar: {
      margin: "auto",
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      borderRadius: 50,
      border: "1px solid",
      height: "70px",
      width: "500px",
    },
    for_searchbyclub: {
      display: "flex",
      width: "200px",
      justifyContent: "center",
      alignItems: "center",
    },
  }));

  const classes = useStyles();
  return (
    <div className={classes.navbar}>
      <ul className={classes.for_ul}>
        <li style={{ fontSize: "25px", color: "black" }}>ClubsHub</li>
        <li>Where passions unite, clubs ignite!</li>
        <li className={classes.for_probut}>
          <img src={logo} className={classes.for_menu}></img>
          <img src={profile_logo} className={classes.for_profile}></img>
        </li>
      </ul>
      <div className={classes.for_searchbar}>
        <div className={classes.for_searchbyclub}>Search Clubs</div>
        <div className={classes.for_searchbyclub}>Search college</div>
        <div>
          <span class="material-symbols-sharp">search</span>
        </div>
      </div>
    </div>
  );
}
